import React, {useEffect, useState} from "react";
import "../../../css/header.css"

export default function Cost_calculation() {
    const [costCalculation, setCostCalculations] = useState([]);

    const orders = () => {
        fetch("/get")
            .then(orders => orders.json())
            .then(orders => {
                console.log(orders);
                // setCostCalculations(orders)
            })
    }

    useEffect(() =>{
        orders()
    })

    return (
        <>
            <div className="cost_calculation">
                <table>
                    <tr>
                        <th>Відправлення</th>
                        <th>Прибуття</th>
                        <th>Номер телефона</th>
                        <th>Вага</th>
                        <th>імя</th>
                        <th>Електронна почта</th>
                    </tr>
                    {
                        costCalculation.map((o) => (
                            <tr>
                                <td key={o.name}>{o.departure}</td>
                                <td key={o.name}>{o.point_of_departure}</td>
                                <td key={o.name}>{o.phone}</td>
                                <td key={o.name}>{o.weight}</td>
                                <td key={o.name}>{o.name}</td>
                                <td key={o.name}>{o.email}</td>
                                <td>
                                    <button onClick={() => {

                                    }}>Delete
                                    </button>
                                </td>
                            </tr>
                        ))
                    }
                </table>
            </div>
        </>
    )
}
